<div class="min-h-screen flex items-center justify-center bg-gray-100">
  <div class="bg-white p-8 rounded shadow-md w-full max-w-sm">
    <h2 class="text-2xl font-bold mb-6 text-center">
      {{ isRegisterMode ? 'SimuBank Register' : 'SimuBank Login' }}
    </h2>
    <form (ngSubmit)="onSubmit()">
      <!-- Name Field (Register Only) -->
      <div class="mb-4" *ngIf="isRegisterMode">
        <label for="name" class="block text-gray-700 text-sm font-bold mb-2">Full Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          [(ngModel)]="name"
          class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          placeholder="Enter your full name"
          required
        />
      </div>

      <!-- Account ID Field -->
      <div class="mb-4">
        <label for="accountId" class="block text-gray-700 text-sm font-bold mb-2">Account ID:</label>
        <input
          type="text"
          id="accountId"
          name="accountId"
          [(ngModel)]="accountId"
          class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          placeholder="Choose an account ID"
          required
        />
      </div>

      <!-- Password Field -->
      <div class="mb-6">
        <label for="password" class="block text-gray-700 text-sm font-bold mb-2">Password:</label>
        <input
          type="password"
          id="password"
          name="password"
          [(ngModel)]="password"
          class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"
          placeholder="Choose a password"
          required
        />
      </div>

      <!-- Submit Button -->
      <div class="flex items-center justify-between">
        <button
          type="submit"
          class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-full"
        >
          {{ isRegisterMode ? 'Register' : 'Login' }}
        </button>
      </div>

      <!-- Toggle Link -->
      <div class="text-center mt-4">
        <a (click)="toggleMode()" class="inline-block align-baseline font-bold text-sm text-blue-500 hover:text-blue-800 cursor-pointer">
          {{ isRegisterMode ? 'Already have an account? Login' : 'Don\'t have an account? Register' }}
        </a>
      </div>
    </form>
  </div>
</div>
